pragma solidity ^0.4.18;

import "./OZ_contracts/crowdsale/CappedCrowdsale.sol";
import "./OZ_contracts/token/StandardToken.sol";
import "./GainmersTOKEN.sol";

/**
 * @title MINDTokenPreSale
 * @dev 
 * We add new features to a base crowdsale using multiple inheritance.
 * We are using the following extensions:
 * CappedCrowdsale - sets a max boundary for raised funds
 *
 * The code is based on the contracts of Open Zeppelin and we add our contracts : MINDTokenPreSale and the Request Token
 *
 * @author Request.network
 */
contract GainmersSALE is Ownable, CappedCrowdsale {
    // hard cap of the token pre-sale in ether
    uint private constant HARD_CAP_IN_WEI = 30000 ether;

    // Total of MIND Token supply
    uint public constant TOTAL_TOKEN_SUPPLY = 100000000;

    // Token sale rate from ETH to MIND
    uint private constant RATE_ETH_GMR = 1160;

    // Token initialy distributed for the team (10%)
    //Here  we will store the ETH fromn the contract
    address public constant TEAM_VESTING_WALLET = 0x627306090abaB3A6e1400e9345bC60c78a8BEf57;
    uint public constant TEAM_VESTING_AMOUNT = 10000000e18; 
    
     // Token initialy distributed for the Advisors (10%)
    address public constant TEAM_ADVISORS_WALLET = 0xf17f52151EbEF6C7334FAD080c5704D77216b732;
    uint public constant TEAM_ADVISORS_AMOUNT = 10000000e18;
    
     // Token reinvestment FLORO (14%)
    address public constant TEAM_REINVEST_WALLET = 0xC5fdf4076b8F3A5357c5E395ab970B5B54098Fef;
    uint public constant TEAM_REINVEST_AMOUNT = 14000000e18;

     // Token initialy distributed for advertisment Bounty Campaing (5%)
    address public constant ADVERTISEMENT_WALLET = 0x821aEa9a577a9b44299B9c15c88cf3087F3b5544;
    uint public constant ADVERTISEMENT_AMOUNT = 5000000e18;

    // PERIOD WHEN TOKEN IS NOT TRANSFERABLE AFTER THE SALE
    uint public constant PERIOD_AFTERSALE_NOT_TRANSFERABLE_IN_SEC = 2 days;

    event PreSaleTokenSoldout();

    function GainmersSALE(uint256 _startTime, uint256 _endTime) public
      CappedCrowdsale(HARD_CAP_IN_WEI)
      ModifiedCrowdsale(_startTime, _endTime, RATE_ETH_GMR, TEAM_VESTING_WALLET)
    {
        
        token.transfer(TEAM_VESTING_WALLET, TEAM_VESTING_AMOUNT);
        token.transfer(TEAM_ADVISORS_WALLET, TEAM_ADVISORS_AMOUNT);
        token.transfer(TEAM_REINVEST_WALLET, TEAM_REINVEST_AMOUNT);
        token.transfer(ADVERTISEMENT_WALLET, ADVERTISEMENT_AMOUNT);


        
    }

    /**
     * @dev Create the MIND token (override createTokenContract of StandardCrowdsale)
     * @return the StandardToken created
     */
    function createTokenContract () 
      internal 
      returns(StandardToken) 
    {
        return new GainmersTOKEN(TOTAL_TOKEN_SUPPLY,
         endTime.add(PERIOD_AFTERSALE_NOT_TRANSFERABLE_IN_SEC),
        TEAM_VESTING_WALLET);
    }



    /**
     * @dev Transfer the unsold tokens to the MIND Foundation multisign wallet 
     * @dev Only for owner
     * @return the StandardToken created
     */
    function drainRemainingToken () 
      public
      onlyOwner
    {
        require(hasEnded());
        token.transfer(TEAM_VESTING_WALLET, token.balanceOf(this));
    }


    /**
      * @dev Action after buying tokens: check if all sold out and enable transfer immediately
      */
    function postBuyTokens ()  internal {
        if ( weiRaised >= HARD_CAP_IN_WEI ) 
{
            GainmersTOKEN gainmersToken = GainmersTOKEN (token);
            gainmersToken.enableTransferEarlier();
            PreSaleTokenSoldout();
        }
    }
}
